import styled from "styled-components";

function SectionClose() {
  return (
    <Container>
      <Wrap>
        <TextBox>
          <p>Thank you for your time and consideration. </p>
        </TextBox>
      </Wrap>
    </Container>
  );
}

export default SectionClose;
